package in.talentify.core.utils;

public class DummyStudent {
String firstname;
String mobilenos;
String email;
String lastname;
String dob;
String gender;
String profile_image;
String company_image;
String batch_name;
String college_name;
String name;
public DummyStudent() {
	super();
	// TODO Auto-generated constructor stub
}
public DummyStudent(String firstname, String mobilenos, String email, String lastname, String dob, String gender,
		String profile_image, String company_image, String batch_name, String college_name, String name) {
	super();
	this.firstname = firstname;
	this.mobilenos = mobilenos;
	this.email = email;
	this.lastname = lastname;
	this.dob = dob;
	this.gender = gender;
	this.profile_image = profile_image;
	this.company_image = company_image;
	this.batch_name = batch_name;
	this.college_name = college_name;
	this.name = name;
}
public String getFirstname() {
	return firstname;
}
public void setFirstname(String firstname) {
	this.firstname = firstname;
}
public String getMobilenos() {
	return mobilenos;
}
public void setMobilenos(String mobilenos) {
	this.mobilenos = mobilenos;
}
public String getEmail() {
	return email;
}
public void setEmail(String email) {
	this.email = email;
}
public String getLastname() {
	return lastname;
}
public void setLastname(String lastname) {
	this.lastname = lastname;
}
public String getDob() {
	return dob;
}
public void setDob(String dob) {
	this.dob = dob;
}
public String getGender() {
	return gender;
}
public void setGender(String gender) {
	this.gender = gender;
}
public String getProfile_image() {
	return profile_image;
}
public void setProfile_image(String profile_image) {
	this.profile_image = profile_image;
}
public String getCompany_image() {
	return company_image;
}
public void setCompany_image(String company_image) {
	this.company_image = company_image;
}
public String getBatch_name() {
	return batch_name;
}
public void setBatch_name(String batch_name) {
	this.batch_name = batch_name;
}
public String getCollege_name() {
	return college_name;
}
public void setCollege_name(String college_name) {
	this.college_name = college_name;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}



}
